=head1 DESCRIPTION

This structure contains information about the OpenSearch Service
workspace used for this integration. An OpenSearch Service workspace is
the collection of dashboards along with other OpenSearch Service tools.
This workspace was created automatically as part of the integration
setup. For more information, see Centralized OpenSearch user interface
(Dashboards) with OpenSearch Service
(https://docs.aws.amazon.com/opensearch-service/latest/developerguide/application.html).

